import React from 'react';
import { useSelector } from 'react-redux';


const ContactListsSidebar = ({ onContactSelect }) => {
  const contacts = useSelector((state) => state.contacts.contacts);
  console.log("this is contacts",contacts)



  return (
    <div className="bg-neutral text-neutral-content p-5 w-64 min-h-screen overflow-y-auto">
      {contacts.map((contact) => (
        <div key={contact.id} onClick={() => onContactSelect(contact.id)} className="cursor-pointer py-2 my-2 border-b border-neutral-content">
          {contact.name} className={`cursor-pointer py-2 my-2 border-b border-neutral-content ${index === contacts.length - 1 ? 'mb-5' : ''}`}
        </div>
      ))}
    </div>
  );
};

export default ContactListsSidebar;
